import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Box } from '@mui/material';
import Dashboard from './components/Dashboard';
import Login from './components/Login';
import EmotionalAnalysis from './components/EmotionalAnalysis';
import PeerSupport from './components/PeerSupport';
import CampusInsights from './components/CampusInsights';
import Navigation from './components/Navigation';
import { EmotionProvider } from './context/EmotionContext';
import { initializeAI } from './services/aiService';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#667eea',
      light: '#8fa7ff',
      dark: '#3f51b5',
    },
    secondary: {
      main: '#764ba2',
      light: '#a477d4',
      dark: '#4a148c',
    },
    background: {
      default: '#0a0e1a',
      paper: '#1a1d29',
    },
    text: {
      primary: '#ffffff',
      secondary: 'rgba(255, 255, 255, 0.7)',
    },
  },
  typography: {
    fontFamily: '"Inter", "Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontSize: '2.5rem',
      fontWeight: 600,
    },
    h2: {
      fontSize: '2rem',
      fontWeight: 600,
    },
    h3: {
      fontSize: '1.5rem',
      fontWeight: 500,
    },
  },
  shape: {
    borderRadius: 12,
  },
  components: {
    MuiCard: {
      styleOverrides: {
        root: {
          background: 'linear-gradient(135deg, rgba(255,255,255,0.1) 0%, rgba(255,255,255,0.05) 100%)',
          backdropFilter: 'blur(10px)',
          border: '1px solid rgba(255,255,255,0.1)',
        },
      },
    },
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: 'none',
          borderRadius: 8,
          fontWeight: 500,
        },
      },
    },
  },
});

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isLoading, setIsLoading] = useState(true);
  const [user, setUser] = useState(null);

  useEffect(() => {
    const initializeApp = async () => {
      try {
        // Initialize AI models
        await initializeAI();

        // Check if user is already logged in
        const savedUser = localStorage.getItem('mindfulcampus_user');
        if (savedUser) {
          setUser(JSON.parse(savedUser));
          setIsAuthenticated(true);
        }
      } catch (error) {
        console.error('Failed to initialize app:', error);
      } finally {
        setIsLoading(false);
      }
    };

    initializeApp();
  }, []);

  const handleLogin = (userData) => {
    setUser(userData);
    setIsAuthenticated(true);
    localStorage.setItem('mindfulcampus_user', JSON.stringify(userData));
  };

  const handleLogout = () => {
    setUser(null);
    setIsAuthenticated(false);
    localStorage.removeItem('mindfulcampus_user');
  };

  if (isLoading) {
    return (
      <Box
        display="flex"
        justifyContent="center"
        alignItems="center"
        minHeight="100vh"
        sx={{ 
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          color: 'white',
          fontSize: '18px'
        }}
      >
        <div style={{ textAlign: 'center' }}>
          <div className="spinner" style={{ margin: '0 auto 20px' }}></div>
          Initializing AI Models...
        </div>
      </Box>
    );
  }

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <EmotionProvider>
        <Router>
          <Box 
            sx={{ 
              minHeight: '100vh',
              background: 'linear-gradient(135deg, #0a0e1a 0%, #1a1d29 100%)'
            }}
          >
            {isAuthenticated ? (
              <>
                <Navigation user={user} onLogout={handleLogout} />
                <Routes>
                  <Route path="/" element={<Dashboard user={user} />} />
                  <Route path="/analysis" element={<EmotionalAnalysis />} />
                  <Route path="/support" element={<PeerSupport user={user} />} />
                  <Route path="/insights" element={<CampusInsights />} />
                  <Route path="*" element={<Navigate to="/" />} />
                </Routes>
              </>
            ) : (
              <Routes>
                <Route path="/login" element={<Login onLogin={handleLogin} />} />
                <Route path="*" element={<Navigate to="/login" />} />
              </Routes>
            )}
          </Box>
        </Router>
      </EmotionProvider>
    </ThemeProvider>
  );
}

export default App;
